import React from 'react'
import { useDispatch } from 'react-redux';
import { login } from '../store/actions/authActions';

const Login = () => {
    const dispatch = useDispatch();

    const handleClick =() => {
        dispatch(login())

        
    }

    return (
        <div>
            <h1>LOGIN</h1>
            <button onClick= {handleClick}>Login</button>
        </div>
    )
}

export default Login
